import React from "react";
import Navigation from "../../../global-components/Navigation/Navigation";
import PageStyles from "../styles/new-user-styles.module.scss";
import CustomButton from "../../../global-components/Button/Button";
import variables from "../../../styles-utils/variables.scss";
import { Link } from "react-router-dom";
import PopularItem from "../components/PopularItem/PopularItem";
import CatalogItem from "../components/CatalogItem/CatalogItem";
import PlusLogo  from "../images/bannerAnimation/Logo_Plus.svg";


function NewUserMainPage() {
  return (
    <div className={PageStyles.page_wrapper}>
      <div className={PageStyles.navWrapper}>
        <Navigation color="primary" pageName={"Подписки"} />
      </div>
      <section className={PageStyles.newUserBannerWrapper}>
        <h1 className={PageStyles.newUseTitle}>Кешбэк до 30% за подписки</h1>
        <p className={PageStyles.bannerDescription}>
          Пользуйся новыми или старыми подписками с выгодой
        </p>
        <div>
          <div className={PageStyles.bannerButtonWrapper}>
            <Link to="/main/details">
              <CustomButton
                buttonName={"Узнать подробнее"}
                backgroundColor={variables.mainButtonColor}
                color={variables.mainTextFontColor}
              />
            </Link>
          </div>
        </div>

        <div className={PageStyles.iconContainer}>
    <img src={PlusLogo} alt="Icon 1" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
    <img src="../images/bannerAnimation/Logo_okko.svg" alt="Icon 2" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
    <img src="../images/bannerAnimation/Logo_spotify.svg" alt="Icon 3" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
    <img src="../images/bannerAnimation/Logo_storytel.svg" alt="Icon 3" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
    <img src="../images/bannerAnimation/Logo_wink.svg" alt="Icon 3" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
    <img src="../images/bannerAnimation/VK (2).svg" alt="Icon 3" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
    <img src="../images/bannerAnimation/Литрес.svg" alt="Icon 3" className="icon-animate" style={{ '--animation-order': 0 } as React.CSSProperties} />
  </div>

      </section>

      <section className={PageStyles.popularWrapper}>


        <h1 className={PageStyles.newUseTitle}>Популярные сервисы</h1>
        <ul className={PageStyles.popularList}>
        <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
          <li>
            {" "}
            <PopularItem />{" "}
          </li>
          </Link>
          <li>
            {" "}
            <PopularItem />{" "}
          </li>
          <li>
            {" "}
            <PopularItem />{" "}
          </li>
        </ul>
      </section>

      <section className={PageStyles.catalogWrapper}>
        <h1 className={PageStyles.newUseTitle}>Каталог подписок</h1>

        <ul className={PageStyles.catalogList}>
          <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={PageStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={PageStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={PageStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={PageStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={PageStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to="/main/card"
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={PageStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
        </ul>
      </section>
    </div>
  );
}

export default NewUserMainPage;
